scriptlet.script:
var jsCondArr = scriptletInput.split(",");
var jsFilterBySiteId = jsCondArr[0];
var jsFilterByDataCenter = jsCondArr[1];
var jsFilterByClientHost = jsCondArr[2];
var jsCheckByVolumeName = jsCondArr[3];
var jsInputArgsOk = "true";

if (jsFilterBySiteId == "false" && jsFilterByDataCenter == "false" && jsFilterByClientHost == "false" && jsCheckByVolumeName == "false")
{
    jsInputArgsOk = "must specify inputs for query: siteId and dataCenter, or clientHost, or volumeName";
}
else if ((jsFilterBySiteId == "true" && jsFilterByDataCenter == "false") && (jsFilterByClientHost == "false" && jsCheckByVolumeName == "false"))
{
    jsInputArgsOk = "must specify dataCenter if siteId is specified";
}
else if ((jsFilterBySiteId == "false" && jsFilterByDataCenter == "true") && (jsFilterByClientHost == "false" && jsCheckByVolumeName == "false"))
{
    jsInputArgsOk = "must specify siteId if dataCenter is specified";
}
else
{
    if ((jsFilterBySiteId == "true" || jsFilterByDataCenter == "true" ) && (jsFilterByClientHost == "true" || jsCheckByVolumeName == "true"))
    {
        if (jsFilterByClientHost == "true")
        {
            jsInputArgsOk = "clientHost mutually exclusive with siteId and dataCenter";
        }
        else if (jsCheckByVolumeName == "true")
        {
            jsInputArgsOk = "volumeName mutually exclusive with siteId and dataCenter";
        }
        else
        {
            jsInputArgsOk = "false";
        }
    }
    else if (jsFilterByClientHost == "true" && jsCheckByVolumeName == "true")
    {
        jsInputArgsOk = "clientHost and volumeName are mutually exclusive";
    }
}
scriptletResult = jsInputArgsOk;

